class VDOM_formdate(VDOM_object):

	def render(self, contents=""):
		display = u"display: none;" if self.visible == "0" else u""

		if self.mode == "1":
			mode = u"""readonly="readonly" """
		elif self.mode == "2":
			mode = u"""disabled="disabled" """
		else:
			mode = u""

		auto = u"off" if self.autocomplete == "0" else u"on"

		clean_id = (self.id).replace('-', '_')
		id = u"o_%s" % clean_id

		# for doctype xhtml 1.0 - width|height depends on padding
		fixw = int(self.width) - 10
		fixh = int(self.height) - 4

		if self.inputmode == "1":
			js = u"""<script type='text/javascript'>$j(function(){
$j.datepicker.setDefaults($j.datepicker.regional['%(regional)s']);
/*$j.datepicker.setDefaults({ dateFormat: 'yy-mm-dd', showButtonPanel: %(showb)s });*/
$j('#%(id)s').datepicker('destroy').datepicker({
	dateFormat: 'yy-mm-dd', showButtonPanel: %(showb)s,
	onSelect: function(d,i) { execEventBinded('%(clean_id)s', "valuechange", {"itemValue": d}); }
});
});</script>""" % { "id": id, "clean_id": clean_id, "regional": self.regional, "showb": "true" if self.showbuttonpanel == "1" else "false"  }
			modestyle = u"background:url('/0f94d563-04ee-0283-2138-62c68af01145.res') right 50% no-repeat;"
		else:
			js = u""
			modestyle = u""

		style = u"""z-index: {zind}; position: {pos}; top: {top}px; left: {left}px; width: {width}px; height: {height}px;
					padding: 2px 5px; {display} font: 14px tahoma; {modestyle}
				""".format(zind = self.zindex, pos = self.position, top = self.top, left = self.left,
						width = fixw, height = fixh, display = display, modestyle = modestyle)

		result = u"""<input id="{id}" ver="2011-12-26" name="{name}" style="{style}" type="text" tabindex="{tabind}"
					value="{value}" class="{classn}" autocomplete="{auto}" {mode} /> {js}
			""".format(id = id, name = self.name, style = style, tabind = self.tabindex,
						value = self.value, classn = self.classname, auto = auto, mode = mode, js = js)

		return VDOM_object.render(self, contents=result)

	def wysiwyg(self, contents=""):
		image_width = image_height = 16
		image_x = image_y = 0

		if int(self.width) > image_width-2 :
			image_x = int(self.width) - image_width - 2
		else :
			image_x = 1
			image_width = int(self.width)-2

		if int(self.height) > image_height :
			image_y = (int(self.height) - image_height - 2)/2
		else :
			image_y = 1
			image_height = int(self.height)-2

		modestyle = u""
		if self.inputmode == "1": # input mode "date"
			modestyle = \
				u"""<image x="{image_x}" y="{image_y}" width="{image_width}" height="{image_height}" href="#Res(0f94d563-04ee-0283-2138-62c68af01145)" />
				""".format(image_x = image_x, image_y = image_y, image_width = image_width, image_height = image_height)

		text = u""
		if self.value :
			text = u"""<text left="{text_x}" top="{text_y}" width="{text_width}" color="#000000">{value}</text>""".format(
				text_x = 2, text_y = image_y,
				text_width = self.width if self.value else 0,
				value = self.value)

		result = \
			u"""<container name="{name}" id="{id}" visible="{vis}" zindex="{zind}" hierarchy="{hierarchy}" order="{order}"
					top="{top}" left="{left}" width="{width}" height="{height}">
					<svg>
						<rect x="0" y="0" width="{rect_width}" height="{rect_height}" fill="#FFFFFF" stroke="#000000"/>
						{modestyle}
					</svg>
					{text}
				</container>
			 """.format(
					id = self.id, vis = self.visible, zind = self.zindex,
					hierarchy = self.hierarchy, order = self.order,
					modestyle = modestyle, text = text, name = self.name,
					top = self.top, left = self.left,
					width = self.width, height = self.height,
					rect_width = int(self.width)-1,
					rect_height = int(self.height)-1)

		return VDOM_object.wysiwyg(self, contents=result)


