def on_update(object, attributes):
	# o = application.objects.search(object_id)

	# if "width" in param:
	# 	width = param["width"]["value"]
	# 	if int(width) < 10:
	# 		o.set_attributes({"width": "10"})
	if "width" in attributes:
		if int(attributes["width"]) < 10:
			attributes.update(width="10")

	# if "height" in param:
	# 	height = param["height"]["value"]
	# 	if int(height) < 4:
	# 		o.set_attributes({"height": "4"})
	if "height" in attributes:
		if int(attributes["height"]) < 4:
			attributes.update(height="4")
